//메인 화면
import React from 'react';

const dummy = {
    isLoggedIn: true,
};

const Home = () => {
    return(
        <div>
            {dummy.IsLoggedIn && <Form encType="multipart/form-data">
                Input.TextArea
            </Form>}
        </div>
    );
};

export default Home;
